import React from 'react';
import injectFeedbacksStyles from './styles';

injectFeedbacksStyles();

interface FeedbacksProps {
  currentUser: { name: string; role: string } | null;
  responses: any[];
}

export default function Feedbacks({ currentUser, responses }: FeedbacksProps) {
  if (!currentUser) {
    return (
      <div className="feedbacks-page">
        <div className="feedbacks-empty">
          <h2>Acesso Restrito</h2>
          <p>Você precisa estar logado para visualizar seus feedbacks.</p>
        </div>
      </div>
    );
  }

  // Filtrar respostas do usuário atual
  const userResponses = responses.filter(r => r.userId === currentUser.name);

  return (
    <div className="feedbacks-page">
      <div className="feedbacks-container">
        <h1>Meus Feedbacks</h1>
        <p className="feedbacks-subtitle">
          Aqui você encontra os feedbacks das pesquisas que você respondeu.
        </p>

        {userResponses.length === 0 ? (
          <div className="feedbacks-empty">
            <p>Você ainda não possui feedbacks. Responda alguns questionários para receber feedback!</p>
          </div>
        ) : (
          <div className="feedbacks-list">
            {userResponses.map((response) => (
              <div key={response.id} className="feedback-card">
                <div className="feedback-header">
                  <h3>Questionário #{response.questionnaireId}</h3>
                  <span className="feedback-date">
                    {new Date(response.timestamp).toLocaleDateString('pt-BR')}
                  </span>
                </div>
                <div className="feedback-body">
                  <p className="feedback-status">
                    Status: <span className="status-pending">Aguardando feedback</span>
                  </p>
                  <p className="feedback-info">
                    {Object.keys(response.answers).length} perguntas respondidas
                  </p>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
}
